# React CSS

## Inline Styles

Inline styles are the most basic way to style a react app. You can use the style prop to add inline styles to any element. For example:
```
const   App   =   ( )   =>   (
   < div   style = { {   backgroundColor :   'red' ,   color :   'white'   } } >
    Hello World
   < / div >
) ;
```
## CSS Modules

CSS Modules allow you to write CSS in a scoped way. This means that you can use the same class names in different components without worrying about conflicts. To use CSS Modules, you need to create a CSS file and import it into your component. For example:
```
// styles.css
. red   {
   background-color :   red ;
   color :   white ;
}

// App.js
import   React   from   'react' ;
import   styles   from   './styles.css' ;

const   App   =   ( )   =>   (
   < div   className = { styles . red } >
    Hello World
   < / div >
) ;
```
